import React, {Component} from 'react';
import img1 from '../../img/image_3.jpg';

export default class Project extends Component{
    render(){
        return (
            <article className="project">
                <div className="img-container">
                    <img src={img1} alt="" />
                </div>
            </article>
        )
    }
}
